import React from "react";
import style from "./Frame.module.css";
import ItemFrame from "./ItemFrame/ItemFrame";
import defState from "../../Redux/defState";
import {Div, Group, Placeholder, Separator, Spacing, SplitLayout} from "@vkontakte/vkui";
import * as PropTypes from "prop-types";

function Sell(props) {
    return null;
}

Sell.propTypes = {children: PropTypes.node};

function Frame(props) {

    let ItemFrameElements = defState.itemList.map( elItem => {
        return(
            <ItemFrame
                id={elItem.id}
                name={elItem.name}
                price={elItem.price}
                imgItem={elItem.imgItem}
                limitExceeded={props.limitExceeded}
                modalRootFunc={props.modalRootFunc}
                openAction={props.openAction}

            />
        )
    })

    return (

        <Group >
            <Div >Одежда</Div>
            <div style={{display:'flex',flexWrap: 'wrap', alignItems: 'center', padding: '10px 0 10px 11px', }}>
                {ItemFrameElements}
            </div>
        </Group>


    )
    }

export default Frame;
